" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Joint laxity",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 207px; height: 351px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Laxity of the wrist allows approximation of the thumb to the patient's ipsilateral forearm. Joint laxity is a crucial feature of the hypermobility syndrome.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from Sheon RP, Moskowitz RW, Goldberg VM. Soft Tissue Rheumatic Pain: Recognition, Management, Prevention, 3rd ed, Williams &amp; Wilkins, Baltimore 1996.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Elbow hypermobility",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 274px; height: 189px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Laxity of the elbow with greater than 10 degrees of joint extension.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Sheon, RP, Moskowitz, RW, Goldberg, VM. Soft Tissue Rheumatic Pain: Recognition, Management, Prevention, 3rd ed. Williams &amp; Wilkins, Baltimore 1996.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Knee hypermobility",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 146px; height: 253px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Laxity of the knee with greater than 10 degrees of joint extension.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from Sheon, RP, Moskowitz, RW, Goldberg, VM. Soft Tissue Rheumatic Pain: Recognition, Management, Prevention, 3rd ed, Williams &amp; Wilkins, Baltimore 1996.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Spinal hypermobility",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 189px; height: 289px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    While keeping the knees locked straight, the person with joint laxity can bend and lay palms to floor.",
